import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <header className="header bg-light shadow-sm p-3">
            <div className="container d-flex justify-content-between align-items-center">
                <div className="logo">
                    <h1 className="text-danger">BOOK RENTAL</h1>
                    <h2 className="text-dark">WEBSITE</h2>
                </div>
                <nav className="nav">
                    <ul className="list-unstyled d-flex">
                        <li className="me-3"><a href="#" className="text-dark">Cart</a></li>
                        <li><a href="#" className="text-dark">Login</a></li>
                    </ul>
                </nav>
                <div className="search-container d-flex">
                    <input type="text" className="form-control me-2" placeholder="Search for book, author, genres..." />
                    <button className="btn btn-danger">Search</button>
                </div>
            </div>
        </header>
    );
};

export default Header;
